@UnivRoma3 @PalladiumRoma3 #RomaTre #FilmFestival Gran finale per la dodicesima edizione del Roma Tre Film Festival al Teatro Palladium con grandi ospiti e le premiazioni dei cortometraggi in concorso.
Giovedì 19 gennaio il cantautore romano EDOARDO DE ANGELIS presenterà e firmerà le copie del suo nuovo album, “IL CANTAUTORE NECESSARIO” (Helikonia / Egea Music,) a ROMA, presso l’ISTITUTO CENTRALE PER I BENI SONORI E AUDIOVISIVI, ex Discoteca di Stato (Palazzo Mattei di Giove – Via Michelangelo Caetani, 32 – ore 16.30 – ingresso gratuito).… Read More Giovedì 19 gennaio EDOARDO DE ANGELIS presenterà a ROMA i brani del suo nuovo album “IL CANTAUTORE NECESSARIO”
